import React, { Component } from 'react';
import Scroll from 'react-scroll';
const ScrollLink = Scroll.ScrollLink;
import About from './about';


class Nav extends Component {
  render(){
   return (
        <ScrollLink 
        style={{color:'white',zIndex:2}}
        to='about'
        spy={true}
        smooth={true}
        duration={500}
        >
         About
        </ScrollLink>
    
  
    );
  }
}

export default Nav;
